Since $\angle ACM = 40^\circ$, $\angle ACP = 140^\circ$, so $\angle ABP = 40^\circ$.  Then $\angle ABC = \angle ABP - \angle CBP = 40^
\circ - 10^\circ = 30^\circ$.

Since $CA = CB$, triangle $ABC$ is isosceles, and $\angle BAC = \angle ABC = 30^\circ$.  Then $\angle BAP = \angle BAC - \angle CAP = 30^\circ - 10^\circ = 20^\circ$.  Hence, $\angle BCP = \angle BAP = \boxed{20^\circ}$.

The triangle is shown below:

[asy]
pair A,B,C;
A = (0,0);
B = (5,0);
C = (5,10);
draw(A--B--C--A);
draw(rightanglemark(C,B,A,16));
label("$A$",A,SW);
label("$B$",B,SE);
label("$C$",C,N);
[/asy]

We have $\sin A = \frac{BC}{AC}$ and $\cos A = \frac{AB}{AC}$, so $\sin A = 2\cos A$ gives us $\frac{BC}{AC} = 2\cdot\frac{AB}{AC}$.  Multiplying both sides by $AC$ gives $BC = 2AB$, so $\frac{BC}{AB} = 2$.  Finally, we have $\tan A = \frac{BC}{AB} = \boxed{2}$.

We also could have noted that $\tan A = \frac{\sin A}{\cos A} = \frac{2\cos A}{\cos A } =\boxed{2}$.

