Note that $f(4) = 5.$  If we set $k$ so that $x + 4 = 5,$ then $k = 1.$  This value of $k$ makes the function continuous, as shown below.

[asy]
unitsize(0.3 cm);

int i;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

label("$x$", (8,0), E);
label("$y$", (0,8), N);

draw((4,5)--(11/2,8),red);
draw((-8,-7)--(4,5),red);
dot((4,5),red);
[/asy]

If $k > 1,$ then the function no longer has an inverse since it fails the horizontal line test.

[asy]
unitsize(0.3 cm);

int i;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

label("$x$", (8,0), E);
label("$y$", (0,8), N);

draw((4,5)--(11/2,8),red);
draw((-8,-6)--(4,6),red);

dot((4,5),red);
filldraw(Circle((4,6),0.15),white,red);
[/asy]

And if $k < 1,$ then the function has an inverse, but that inverse is not defined for all real numbers.  Specifically, the inverse is not defined on the interval $[k + 4,5).$

[asy]
unitsize(0.3 cm);

int i;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

label("$x$", (8,0), E);
label("$y$", (0,8), N);

draw((4,5)--(11/2,8),red);
draw((-8,-8)--(4,4),red);

dot((4,5),red);
filldraw(Circle((4,4),0.15),white,red);
[/asy]

Therefore, the only possible value of $k$ is $\boxed{1}.$

The graph of the original parabola ($A$) and its final image ($A'$) after rotation and translation is shown below:

[asy]

Label f;

f.p=fontsize(4);

xaxis(-4,4,Ticks(f, 2.0));

yaxis(-6,5,Ticks(f, 2.0));

real f(real x)

{

return x^2-4;

}

draw("$A'$", graph(f,-3,3), linewidth(1));

real g(real x)

{

return -(x+1)^2+1;

}

draw("$A$", graph(g,-3.5,1.5), linewidth(1));

[/asy]

Shifting the original parabola 1 unit to the right changes its equation to $y=-x^2+1$. Shifting this last parabola 5 units down changes its equation to $y=-x^2-4$. Rotating it by 180 degrees changes its equation to $y=x^2-4$. So the equation of $A'$ is $y=x^2-4$. To find the zeros of this parabola, we set $y=0$ to get $0=x^2-4$. Factoring the right hand side, we get $0=(x-2)(x+2)$, so either $x-2=0\Rightarrow x=2$ or $x+2=0 \Rightarrow x=-2$. Thus, $a=-2$ and $b=2$, so $b-a=\boxed{4}$.

First, we build a diagram:

[asy]

size(150); defaultpen(linewidth(0.8));

