From quadrilateral $CXHY$, we have  \begin{align*}
\angle ACB = \angle XCY &= 360^\circ - \angle HXC - \angle YHX - \angle CYH \\
&= 360^\circ - 90^\circ - \angle YHX - 90^\circ\\
&= 180^\circ - \angle YHX.
\end{align*}Since $\angle YHX = \angle AHB$, we have $\angle ACB = 180^\circ - \angle YHX = \boxed{48^\circ}$.

The angles in quadrilateral $MONC$ add up to $360^\circ$.  Two of these angles, namely $\angle OMC$ and $\angle ONC$, are right.  Therefore, $\angle MON + \angle MCN = 180^\circ$, which means $\angle MON = 180^\circ - \angle MCN = 180^\circ - 47^\circ = \boxed{133^\circ}$.

