original_solution:
The focus of the parabola $y^2 = 4ax$ is $F = (a,0),$ and the directrix is $x = -a.$  Then
\[PQ = PF + QF.\][asy]
unitsize(0.8 cm);

real y;
pair F, P, Q;

F = (1,0);

path parab = ((-4)^2/4,-4);

for (y = -4; y <= 4; y = y + 0.01) {
  parab = parab--(y^2/4,y);
}

P = intersectionpoint(F--(F + 5*(1,2)),parab);
Q = intersectionpoint(F--(F - 5*(1,2)),parab);

draw(parab,red);
draw((-2,0)--(4^2/4,0));
draw((0,-4)--(0,4));
draw((-1,-4)--(-1,4),dashed);
draw(P--Q);
draw(P--(-1,P.y));
draw(Q--(-1,Q.y));

label("$x = -a$", (-1,-4), S);

dot("$F$", F, SE);
dot("$P$", P, SE);
dot("$Q$", Q, S);
dot((-1,P.y));
dot((-1,Q.y));
[/asy]

Since $P$ lies on the parabola, $PF$ is equal to the distance from $P$ to the directrix, which is $x_1 + a.$  Similarly, $QF$ is equal to the distance from $Q$ to the directrix, which is $x_2 + a.$  Therefore,
\[PQ = x_1 + x_2 + 2a.\]Hence, $c_1 + c_2 + c_3 = 1 + 1 + 2 = \boxed{4}.$

We combine the terms with variables, and the terms without variables, and we have  \begin{align*}
3t+4-6t+7t - 4 &= (3t -6t +7t) + (4-4)\\
&=\boxed{4t}
\end{align*}

Place under one square root and simplify: \begin{align*}
\sqrt{15}\cdot\sqrt{35} &= \sqrt{15\cdot35}\\
&=\sqrt{3\cdot5^2\cdot7}\\
&=\sqrt{5^2}\cdot\sqrt{3\cdot7}\\
&= \boxed{5\sqrt{21}}
\end{align*}

The greatest common factor of $28z^{97}$ and $7z^{96}$ is $7z^{96}$. We factor $7z^{96}$ out of both terms to get\begin{align*}
28z^{97}+7z^{96} &= 7z^{96}\cdot 4z +7z^{96}\cdot 1\\
&= \boxed{7z^{96}(4z+1)}.
\end{align*}

In isosceles right triangle $\triangle ABC$ below, $\overline{AD}$ is the altitude to the hypotenuse.

[asy]
import olympiad;
unitsize(0.8inch);
pair A,B,C,D;
A = (0,1);
B= (1,0);
C = -B;
D = (0,0);
draw(A--B--C--A,linewidth(1));
draw(A--D,linewidth(0.8));
draw(rightanglemark(C,A,B,s=4));
draw(rightanglemark(C,D,A,s=4));
label("$A$",A,N);
label("$B$",B,S);
label("$C$",C,S);
label("$D$",D,S);
[/asy]

Because $\triangle ABC$ is an isosceles right triangle, $\angle ABC = 45^\circ$.  Since $\angle ADB = 90^\circ$, we know that $\angle DAB = 45^\circ$, so $\triangle ABD$ is also a 45-45-90 triangle.  Similarly, $\triangle ACD$ is a 45-45-90 triangle.  Therefore, $DA=DB = DC = 5$, so $BC = BD+DC = 10$, and  \[[ABC] = \frac{(AD)(BC)}{2} = \frac{(5)({10})}{2} = \boxed{25}.\]

