Let the number of clowns in the parade be $c$ and the number of horses be $h$. We are looking for the value of $h$. Assuming that each clown has 2 legs and 1 head, and that each horse has 4 legs and 1 head, we can set up the following system of equations:

\begin{align*}
2c+4h &= 30 \\
c + h &= 10 \\
\end{align*}

To solve for $h$, we need to eliminate $c$ from the equations above. We can rewrite the second equation above as $c=10-h$, and substituting this into the first equation to eliminate $c$ gives $2(10-h)+4h = 30$, or $h=5$. Thus, there are $\boxed{5}$ horses in the parade.

Let $j$ be John's age and $d$ be his dad's age. We are trying to find the value of $d$. We can create a system of two equations to represent the given information. They are

\begin{align*}
j &= d - 31 \\
j + d &= 53 \\
\end{align*}

We want to find $d$, so we need to eliminate $j$ from the equations above. Substituting the first equation into the second to eliminate $j$, we have $(d-31)+d=53$, or $d=42$. Thus, John's dad is $\boxed{42}$ years old.

Cancel some factors of 2 before subtracting: \begin{align*}
\frac{2^{10}-2^8}{2^7-2^6}&=\frac{2^8(2^{2}-1)}{2^6(2^1-1)} \\
&=2^2\left(\frac{3}{1}\right) \\
&=\boxed{12}.
\end{align*}

